import React from 'react'

import Chart from '../Chart/Chart';
const chartDataPoints = [
  {label: 'Jan', Value: 0},
  {label: 'Feb', Value: 0},
  {label: 'Mar', Value: 50},
  {label: 'Apr', Value: 0},
  {label: 'May', Value: 0},
  {label: 'Jun', Value: 0},
  {label: 'Jul', Value: 0},
  {label: 'Aug', Value: 0},
  {label: 'Sep', Value: 0},
  {label: 'Oct', Value: 100},
  {label: 'Nav', Value: 0},
  {label: 'Dec', Value: 0},
]
const ExpensesChart = (props) => {

  for (let expense of props.expenses) {
    const expenseMonth = expense.date.getMonth(); // start with 0 => January = 0
    chartDataPoints[expenseMonth].Value = chartDataPoints[expenseMonth].Value + expense.Value 
  }



  return (
    <Chart dataPoints={chartDataPoints}/>
  )
}

export default ExpensesChart
